import React from 'react';
import { Segment, Header } from 'semantic-ui-react'

class HeaderComp extends React.Component {
    render() {
        return (
            <Segment inverted>
                <Header textAlign="center">
                    Calculator
                </Header>
            </Segment>
        );
    }
}

export default HeaderComp;
